import { Button, HStack } from "@chakra-ui/react";
import React from "react";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <HStack p={"89"} shadow={"base"} bgColor={"black.400"} justifyContent={"center"}>
      <Button variant={"solid"} color={"white"} borderRadius={"full"} bgColor={"blue.500"} _hover={{ bg: "blue.600" }}>
        <Link to="/">Home</Link>
      </Button>
      <Button variant={"solid"} color={"white"} borderRadius={"full"} bgColor={"green.500"} _hover={{ bg: "green.600" }}>
        <Link to="/exchanges">Exchanges</Link>
      </Button>
      <Button variant={"solid"} color={"white"} borderRadius={"full"} bgColor={"red.500"} _hover={{ bg: "red.600" }}>
        <Link to="/coins">Coins</Link>
      </Button>
    </HStack>
  );
};

export default Header;
